pub enum ExecuteMsg {
    Receive(Cw20ReceiveMsg),
    UpdateConfig {
        owner: String,
    },
    OpenPosition {
        vamm: String,
        side: Side,
        quote_asset_amount: Uint128,
        leverage: Uint128,
    },
    ClosePosition {
        vamm: String,
    },
}

pub enum Cw20HookMsg {
    OpenPosition {
        vamm: String,
        side: Side,
        leverage: Uint128,
    },
}

pub enum QueryMsg {
    Config {
    },
    Position {
        vamm: String,
        trader: String,
    },
    TraderBalance {
        trader: String,
    },
}

pub enum ExecuteMsg {
    AppendPrice {
        key: String,
        price: Uint128,
        timestamp: u64,
    },
    AppendMultiplePrice {
        key: String,
        prices: Vec<Uint128>,
        timestamps: Vec<u64>,
    },
    UpdateConfig {
        owner: Option<String>,
    },
}

pub enum QueryMsg {
    Config {
    },
    GetPrice {
        key: String,
    },
    GetPreviousPrice {
        key: String,
        num_round_back: Uint128,
    },
    GetTwapPrice {
        key: String,
        interval: u64,
    },
}

pub enum ExecuteMsg {
    SwapInput {
        direction: Direction,
        quote_asset_amount: Decimal256,
    },
    SwapOutput {
        direction: Direction,
        base_asset_amount: Decimal256,
    },
    UpdateConfig {
        owner: Option<String>,
        toll_ratio: Option<Decimal256>,
        spread_ratio: Option<Decimal256>,
    },
}

pub enum QueryMsg {
    Config {
    },
    State {
    },
    OutputPrice {
        direction: Direction,
        amount: Decimal256,
    },
    CalcFee {
        quote_asset_amount: Decimal256,
    },
}
